def F(N, k):
    n = int(math.log(N * (k - 1) + 1, k))
    a = [0] * (n + 1)
    num = N - ((k ** n) - 1)/(k - 1)
    for i in range(n, -1, -1):
        if k ** i <= num:
            a[i] = int(num/(k ** i))
            num %= (k ** i)
    res = 0
